import { ADD_FAVOTIRE, DELETE_FAVOTIRE } from "./actionsTypes";

export const addFavorite = (id) => {
    return {
        type: ADD_FAVOTIRE,
        payloead: id
    }
}

export const deleteFavorite = (id) => {
    return {
        type: DELETE_FAVOTIRE,
        payloead: id
    };
};
